Lemma rank_right_height : forall h : heap, has_leftist_property h = true -> rank h = right_height h.
Proof.
intros.
induction h.
- auto.
- simpl.
simpl in H.
apply andb_true_iff in H.
destruct H.
apply Nat.eqb_eq in H0.
assumption.
Qed.
